import React, { useState ,useEffect} from 'react'
import ContentImage from "../assets/contentImage.webp";
import Iphone15 from "../assets/iphone15.jpg";
import "../styles/home.css"
export default function Home(props) {
  const [data, setData]=useState([]);

      useEffect( ()=>{  
        fetch('menus.json').then((res)=>res.json())
      .then((myJson)=>{
        console.log(typeof myJson)
        setData(myJson)
      })
      },[])
  
  return (
    
    <div className='container'>
     {data.map((item,index)=>{
        return(
        <div className='row' id='imageContainer'>
        {/* <h1 style={{textAlign:"center"}}>{props.Children}</h1> */}
        <section key={item} className='card'>
       <img src={index} alt='listItem'/>
        </section>
       
        </div>
        )
      })
     }
    </div>
  )
};
